openapi: 3.0.1
info:
  contact:
    email: support@mydatamyconsent.com
    name: My Data My Consent API Support
    url: https://mydatamyconsent.com/en-us/developers
  description: Unleashing the power of data consent by establishing trust. The Platform
    Core Developer API defines a set of capabilities that can be used to request,
    issue, manage and update data, documents and credentials by organizations. The
    API can be used to request, manage and update Decentralised Identifiers, Financial
    Data, Health Data issue Documents, Credentials directly or using OpenID Connect
    flows, and verify Messages signed with DIDs and much more.
  license:
    name: Terms of Service
    url: https://mydatamyconsent.com/en-us/legal/terms-of-service
  termsOfService: https://mydatamyconsent.com/en-us/legal/terms-of-service
  title: My Data My Consent - Developer API
