            application/xml:
              schema:
                $ref: '#/components/schemas/DataConsent'
          description: Success
        "500":
          description: Server Error
        default:
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
            application/xml:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Error
      summary: Create a consent request.
      tags:
      - DataConsentRequests
      x-contentType: application/json
      x-accepts: application/json
